import React from 'react'

const Card = ({ img }) => {
    return (
        <div className='card'>
            <img className='card-photo' src={`../images/${img}`} />
            <div className='card--bottom'>
<img src='../images/pig-tab-icon.png'/>
                <p>{img.split('.')[0].replace('_', ' ')}</p>
            </div>
        </div>
    )
}

export default Card
